function Onglet(){
  return(
    <>
      <nav>
        <ul>
          <li><a href='#'>Accueil</a></li>
          <li><a href='#'>Blog</a></li>
          <li><a href='#'>Messages</a></li>
          <li><a href='#'>Contacts</a></li>
        </ul>
      </nav>
    </>
  );
}

export default function App(){
  return (
    <>
      <Onglet />
      <h1>Hello world!</h1>
    </>
  );
}
